import React from "react";
import { variables } from "./Variables";
export class Student extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            students: [],
            modalTittle: "",
            studentid: 0,
            studentname: "",
            CONTACT: "",
            EMAIL: "",
            studentregno: "",
            Status: ""
        }
    }
    refreshList() {
        fetch(variables.API_URL + 'student?Status=Active')
            .then(response => response.json())
            .then(data => {
                this.setState({ students: data });
                console.log(data);
            });
    }
    changestudentid = (e)=>{this.setState({studentid:e.target.value});}
    // changeStartTime = (e)=>{this.setState({StartTime:e.target.value});}
    // changeEndTime = (e)=>{this.setState({EndTime:e.target.value});}
    componentDidMount(){
        this.refreshList();
    }

    addclick(){
        this.setState({
            modalTittle: "Add student",
            studentid: 0,
            studentregno: "",
            studentname: "",
            EMAIL: "",
            CONTACT: "",
            Status: ""
        })
    }
    render(){
        const {
            students,
            modalTittle,
            studentid,
            studentname,
            CONTACT,
            EMAIL,
            studentregno,
            Status
        } = this.state


        return(
            <div>
                <button type="button" className="btn btn-primary m-2 float-end" data-bs-toggle="modal"
                    data-bs-target="#exampleModal" data-bs-backdrop="static" onClick={()=>this.addclick()}>Add Student</button>
                <table className="table table-stripped">
                    <thead>
                        <tr>
                            <th>Student Id</th>
                            <th>Registration Number</th>
                            <th>Student Name</th>
                            <th>Contact No</th>
                            <th>Email</th>
                            <th>Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            students?.map(s =>
                                <tr key={s.studentid}>
                                    <td>{s.studentid}</td>
                                    <td>{s.studentregno}</td>
                                    <td>{s.studentname}</td>
                                    <td>{s.CONTACT}</td>
                                    <td>{s.EMAIL}</td>
                                    <td>{s.Status}</td>
                                </tr>
                            )
                        }
                    </tbody>
                </table>
                <div class="modal fade" id="exampleModal" tabindex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
                    <div class="modal-dialog" role="document">
                        <div class="modal-content">
                            <div class="modal-header">
                                <h5 class="modal-title" id="exampleModalLabel">{modalTittle}</h5>
                                <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                                    <span aria-hidden="true">&times;</span>
                                </button>
                            </div>
                            <div class="modal-body">
                                <div className="input-group mb-3">
                                    <span className="input-group-text">Student ID</span>
                                    <input type="text" className="form-control" value={studentid} onChange={this.changestudentid}/>
                                </div>
                           </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
